import React from "react";
import CustomButton from "./button";
import { AddCircle } from "@mui/icons-material";
export const Render = () => {
  return (
    <>
      <CustomButton size  startIcon = {<AddCircle/>} onClick={() => console.log("Button clicked!")}>
        Custom
      </CustomButton>
      <CustomButton size = "large" startIcon = {<AddCircle/>} onClick={() => console.log("Button clicked!")}>
        Custom
      </CustomButton>
    </>
  );
};
